INSERT INTO `berita` (`idberita`, `title`, `content`, `image`, `postdate`, `author`) VALUES
(34, 'Pemerintah menanggung iuran JKN bagi masyarakat miskin dan tidak mampu', 'Pemerintah menanggung iuran JKN bagi masyarakat miskin dan tidak mampu, yang jumlahnya mencapai 86,4 juta orang, termasuk 4.192.297 orang di Propinsi Sumatera Utara. Kelompok ini disebut dengan Penerima Bantuan Iuran (PBI)', '', '2014-03-20 00:00:00', 'admin'),
(36, 'Setiap Orang Perlu Jaminan Kesehatan, Karena Setiap Orang Berisiko Jatuh Sakit', 'JKN adalah program jaminan sosial kesehatan nasional, yang diamanatkan dalam Undang-Undang No. 40 tahun 2004 tentang Sistem Jaminan Sosial Nasional (SJSN). Jaminan Kesehatan ini mengacu pada prinsip asuransi sosial, yaitu: peserta wajib membayar iuran yang cukup terjangkau, dapat dilayani di semua wilayah Indonesia\r\n', '', '2014-03-20 00:00:00', 'admin'),
(46, 'POTENSI SUMBERDAYA ALAM KABUPATEN KEEROM', '<p><span>Tanaman Pangan dan Hortikultura</span><br /><br /><span>Pada beberapa lokasi, pertanian tanaman pangan di Kabupaten Keerom masih&nbsp dilakukan dengan sistem tradisional sehingga tingkat produktivitas masih rendah.&nbsp Akan tetapi pada kawasan-kawasan yang berkembang terutama di wilayah transmigrasi&nbsp (Distrik Arso dan Distrik Skanto), budidaya tanaman pangan dan hortikultura telah dilakukan secara lebih&nbsp intensif dan&nbsp telah menerapkan teknologi budidaya yang modern. Oleh karena itu, sub-sektor pertanian tanaman pangan dan hortikultura mampu menjadi kontributor utama dalam perekonomian sektor pertanian maupun perekonomian wilayah kabupaten. Luas penggunaan lahan untuk tanaman pangan di Kabupaten Keerom pada Tahun Tahun 2010 mencapai 2.227 ha. Dan untuk tanaman hortikultura pada tahun yang sama mencapai luas 1.864 ha. Komoditas yang menonjol peranannya pada sub-sektor tanaman pangan dan hortikultura adalah Ubi Jalar, Ubi Kayu, dan Padi Sawah. Ketiga komoditas ini merupakan penyumbang utama bagi produk wilayah Kabupaten. Produksi ketiga komoditas pada Tahun 2010 berturut-turut adalah 2.714 ton, 2.360 ton dan 1.287 ton.dan 1.190 ton.</span><br /><br /><span>Sumber Daya Mineral</span><br /><br /><span>Keberadaan sumberdaya mineral di daerah ini ditafsirkan dari kondisi global dan peristiwa tektonik, sehingga dengan munculnya batuan interusi seperti dirit, granodiorit, monzonit dan andesit yang menerobos batuan sekitarnya, tidak menutup kemungkinan adanya daerah potensi mineralisasi seperti emas, tembaga dan minerallainya di daerah Amgotro dan Ubrub bagian selatan. Mineralisasi tembaga dan emas di jalur Pegunungan Tengah&nbsp Papua sangat erat hubungannya dengan munculnya intrusi diroit atau monzonit yang umum terdapat di aljur Papua Ofiolit Belt. Dengan demikian bagian selatan Kabupaten Keerom, yang banyak dijumpai batuan intrusi tersebut, sangat berpotensi terdapatnya mineralisasi emas dan tembaga. Kemunculan batuan ultrabasa, dapat dijadikan sebagai indikasi batuan sumber dari tersedianya berbagai endapan logam, seperti Nikel, Mangan,Timah Hitam, Besi dan Kromit serta adanya energi fosil Batubara. Proses laterisasi yang dihasilkan oleh pelapukan batuan ultra basa yang berumur Pra Tersier sangat berpotensi untuk menghasilkan endapan tersebut. Selain potensi mineralisasi emas primer, maka emas sekunder berupa emas plaser telah telah banyak dilaporkan di temukan di sekitar Sungai Keerom yang diperkirakan bersumber dari batuan gunung api Auwewa yang berumur Oligo-Miosen. Bahan bangunan seperti batuan beku diorit, andesit, gabro, basal, ultrabasa dan batuan sedimen keras lainnya dapat digunakan sebagai bahan bangunan pondasi, jalan dan sebagainya. Batu gamping dan batulempung yang banyak terdapat di daerah ini dapat dimanfaatkan sebagai bahan baku semen.</span><br /><br /><span>Kehutanan</span><br /><br /><span>Sumber daya hutan merupakan potensi alam yang paling besar dimiliki Kabupaten Keerom, dan pada umumnya potensi ini belulm banyak dimanfaatkan. Sebagian besar Kabupaten Keerom ditutupi oleh hutan, yaitu mencapai luas 942.157,31 ha (88,04% dari luas kabupaten). Pada tahun 2010, sub-sektor kehutanan mampu menyumbang PDRB Kabupaten Keerom sebesar 8,53 % dan menempati urutan ketiga dalam sektor pertanian. Perencanaan tata ruang harus mengalokasikan wilayah lindung dan budidaya hutan secara proporsional untuk menjamin tercapainya pemanfaatan sumberdaya hutan secara berkelanjutan. Berdasarkan kajian di lapangan diketahui bahwa Kabupaten Keerom terdapat 5 macam kawasan hutan yang meliputi Hutan Lindung (HL), Hutan Produksi (HP), Hutan Produksi Konversi (HPK), Hutan Produksi Terbatas (HPT), dan kawasan suaka alam. Luas keseluruhan kawasan hutan tersebut mencapai 841.857 ha (71,51% dari areal berhutan). Berbagai komoditas yang dapat dikembangkan pada sub-sektor kehutanan antara lain meliputi yaitu kayu, rotan, dan kulit kayu yang dapat dioilah menjadi plywood, block-board, veneer, lumber-core, kayu gergajian dan poliyester. Selain itu dapat pula dikembangkan produk non kayu seperti madu, plasma nutfah, dan jasa lingkungan hutan lainnya.</span><br /><br /><span>Peternakan</span><br /><br /><span>Sub sektor peternakan merupakan salah satu sub sektor yang harus diperhatikan karena dapat memberikan kontribusi terhadap perekonomian jika dimanfaatkan dan dikembangkan secara optimal. Secara umum populasi ternak yang ada di Kabupaten Keerom terbagi dalam dua jenis yaitu populasi ternak besar, ternak kecil, dan unggas. Sapi dan kambing merupakan populasi ternak tertinggi yang banyak dikembangbiakan di kabupaten ini, kemudian disusul oleh ternak Babi, sedangkan ternak unggas yang banyak dikembangbiakkan di Kabupaten Keerom adalah Ayam Ras, Ayam Buras, Angsa, Itik dan Entok. Populasi Ayam Buras merupakan populasi terbesar yang dikembangbiakan di Kabupaten Keerom (61.520 ekor). Secara garis besar hal ini disebabkan karena pengusahaannya tidak terlalu memerlukan penanganan yang rumit.</span><br /><span><br />Perikanan</span><br /><br /><span>Berdasarkan potensi badan air yang ada, pengembangan perikanan dapat dilakukan, terutama perikanan budidaya, baik pada kolam, empang, maupun jaring apung atau keramba.&nbsp Jenis-jenis halis perikanan yang dibudidayakan antara lain Ikan Mas, Mujair, Nila, Lele Dumbo dan Bawal. Populasi ikan terbesar yang dibudidayakan adalah Ikan Nila sekitar 32 ton dengan nilai jual sebesar 720 juta, dan Ikan Mas sekitar 9 ton dengan nilai jual sebesar 202 juta.&nbsp</span><br /><br /><span>Perkebunan</span><br /><br /><span>Perkebunan kelapa sawit dan kakao merupakan kegiatan perkebunan yang memiliki areal lahan terluas yaitu lebih dari 47.986,98 ha atau mencapai lebih dari 99% luas lahan&nbsp tanaman perkebunan di Kabupaten Keerom. Pada tahun 2010 komoditas kelapa sawit telah memberikan tanaman panen dengan luas 8.686,98 ha dengan produksi mencapai 90.588,16 ton, sedangkan kakao seluas 7.000ha mencapai 9.500 ton. Berdasarkan potensi lahan yang ada, komoditas perkebunan sangat potensial untuk dikembangkan di Kabupaten Keerom, terutama komoditas yang banyak diminta pasar internasional (eksport) seperti kelapa sawit (CPO) dan Kakao. Disamping itu, komoditas tersebut mampu menggerakan industri berbasis pertanian (agro industri) dan menyerap banyak tenaga kerja baik pada on farm maupun off farm.</span><br /><span>Berikut ini adalah beberapa investor yang telah menjalankan usahanya di Kabupaten Keerom pada sektor perkebunan :</span><br /><span><br />PTPN II</span><br /><br /><span>PTPN II merupakan pionir dalam pengembangan kelapa sawit di Kabupaten Keerom, yaitu dimulai sekitar tahun 1983 yang pada saat itu mengembangkan kelapa sawit bersama-sama dengan para petani transmigram Pirsus sebagai Plasma dan PTPN II sebagai intinya. Saat ini luas panen PTPN II Arso setiap bulanya mencapai rata-rata 2.286 Ha dan 1.068 yang dikolola oleh PT. Bumi Irian Perkasa. Sebagian besar lahan panen merupakan areal plasma denga luas sekitar 3.600 Ha. Jumlah CPO yang dihasilkan oleh perkebunan kelapa swit ini berfluktuasi setiap bulanya, jumlah yang terbesar terjadi pada bulan juni yaitu 1.700,59 Ton.&nbsp</span><br /><br /><span>PT. Tandan Sawita PapuaPT. Tandan Sawita dapat dikatakan salah satu investor baru di Kabupaten Keerom. Sesuai SK Gubernur Provinsi Papua No. 7 Tahun 2010 tanggal 24 Januari 2010, PT Tandan Sawita Papua mendapat areal hutan APL seluas 18.337,90 ha di Distrik Arso Timur Kabupaten Keerom, untuk kepentingan membangun perkebunan Kelapa Sawit.&nbsp</span><br /><span>Perkembangan pemanfaatan dan pembukaan hutan yang dilakukan :</span><br /><span>-Luas areal kerja&nbsp&nbsp&nbsp &nbsp&nbsp &nbsp &nbsp &nbsp &nbsp &nbsp &nbsp&nbsp &nbsp : 18.337,90 ha</span><br /><span>-Luas area Konservasi dll&nbsp&nbsp &nbsp&nbsp&nbsp&nbsp : 4.477,82 ha</span><br /><span>-Luas lahan efektif&nbsp&nbsp&nbsp &nbsp&nbsp &nbsp &nbsp &nbsp &nbsp &nbsp&nbsp&nbsp : 13.862 ha&nbsp</span></p>', '', '2018-11-14 09:20:32', 'admin'),
(38, 'Apa itu Keerom Pu Data ?', '<p>Apa itu Keerom Pu Data ?&nbsp adalah Wadah yang berfungsi sebagai pengelola data dan informasi pembangunan daerah. Selain itu Pusat Data dan Analisa Pembangunan berfungsi untuk : Menjembatani jaringan-jaringan dengan pemangku kepentingan pembangunan Mendukung dipergunakannya data dan informasi tersebut oleh pemerintah daerah untuk memperbaiki kualitas pengelolaan keuangan daerah Mendorong pengembangan kapasitas dan secara proaktif menyebarkan data dan informasi (terutama dokumen-dokumen perencanaan dan penganggaran) kepada publik dan pemerintah.</p>', '', '2018-10-22 10:40:23', 'admin');
